var LMD_dimpleHelper = (function(){

    // Monthly line graph
    function createChart(params){

        // Create new dimple SVG; set data; create new chart object
        var svg = dimple.newSvg("#" + params.targetDiv, params.size.x, params.size.y);
        var myChart = new dimple.chart(svg, params.data);

        // Set color scheme
        myChart.defaultColors = [];
        var defaultColorArray = ["#F79646", "#9BBB59", "#4BACC6", "#C0504D", "#8064A2"];
        if (params.colors !== "default") {
            for (var i=0; i<params.colors.length; i++) {
                myChart.defaultColors.push(new dimple.color(params.colors[i]));
            }
        } else {
            for (var i=0; i<defaultColorArray.length; i++) {
                myChart.defaultColors.push(new dimple.color(defaultColorArray[i]));
            }
        }

        // Format chart
        myChart.setBounds(55, 30, params.size.x-75, params.size.y-75);
        if (params.type==="line") {
            var x = myChart.addTimeAxis("x", params.xyVars.x, "%Y-%m-%d", "%b '%y");
            x.timePeriod = d3.time.months;
            x.timeInterval = params.timeInterval;
            var y = myChart.addMeasureAxis("y", params.xyVars.y);
        } else if (params.type==="pie") {
            var x = myChart.addCategoryAxis("x", "Month");
            myChart.addCategoryAxis("y", "");
            myChart.addMeasureAxis("p", "Value");
            var pies = myChart.addSeries(params.cut, dimple.plot.pie); // !!!!! this needs to be variablized !!!!!
            pies.radius = 25;
            myChart.addLegend(140, 10, 330, 20, "right"); // !!!!! this needs to be variablized !!!!!
        }
        
        if (params.type==="line") {
            // Add axis titles
            if (params.axisTitles && params.axisTitles.x) {
                x.title = params.axisTitles.x;
            }
            if (params.axisTitles && params.axisTitles.y) {
                y.title = params.axisTitles.y;
            }

            // Add tick formats
            if (params.tickFormat && params.tickFormat.x) {
                x.tickFormat = params.tickFormat.x;
            }
            if (params.tickFormat && params.tickFormat.y) {
                y.tickFormat = params.tickFormat.y;
            }

            // Add series; add legend; draw chart
            myChart.addSeries(params.cut, dimple.plot.line);
            if (params.legend !== "") {
                myChart.addLegend(65, 10, 510, 20, params.legend);
            }
        }
        myChart.draw();
    }

    // Description
    return {
        createChart: createChart
    };

})();

// This page loads site content via AJAX. Allows for easier site maintenance.

$(document).ready(function() {
    
    // Load the navbar HTML; run callback
    $('#load_navbar').load('/LastMileData/src/php-html/includes/header_bootstrap.html', function() {
        
        // Get current URL and split out the page
        var currentURL = document.URL;
        var urlParts = currentURL.split("/");
        var page = urlParts[urlParts.length-1];
        var pageParts = page.split(".");
        page = pageParts[0] || 'page_home';
        
        // Add "active" class to appropriate navbar <li> to highlight it
        $('#' + page).addClass('active');
        
        // Fade in page body
        $('body').fadeIn(1500);
        
        // Add click handler for change PW button
        $('#modal_changePW_submit').click(function() {
            
            // Manipulate DOM; show loader GIF
            $('#modal_changePW_form').slideUp(500,function(){
                $('#modal_changePW_message').html("<img src='/LastMileData/src/images/ajax-loader_v20140916.gif'>").delay(500).slideDown(500, function(){

                    setTimeout(function(){

                        // Collect form data
                        var pw_old = $('#modal_changePW_pw_old').val();
                        var pw_new_1 = $('#modal_changePW_pw_new_1').val();
                        var pw_new_2 = $('#modal_changePW_pw_new_2').val();

                        // Run password-change script ("changePassword.php") via ajax
                        $.ajax({
                            url: "/LastMileData/src/php-html/scripts/changePassword.php",
                            data: "pw_old=" + pw_old + "&pw_new_1=" + pw_new_1 + "&pw_new_2=" + pw_new_2 + "&username=" + sessionStorage.username,
                            dataType: "json",
                            success: function(data) {

                                // Script response: old password is incorrect
                                if ( data == 'old_pw_bad' ) {
                                    $('#modal_changePW_message').slideUp(500, function(){
                                        $(this).html('Old password is incorrect. Please try again.').slideDown(500, closeAndResetModal);
                                    });
                                }
                                // Script response: new passwords don't match
                                else if ( data == 'new_pws_dont_match' ) {
                                    $('#modal_changePW_message').slideUp(500, function(){
                                        $(this).html('New passwords don\'t match. Please try again.').slideDown(500, closeAndResetModal);
                                    });
                                }
                                // Script response: success
                                else if ( data == 'pw_success' ) {
                                    $('#modal_changePW_message').slideUp(500, function(){
                                        $(this).html('Success! New password has been set.').slideDown(500, closeAndResetModal);
                                    });
                                }
                                // Error handler
                                else {
                                    $('#modal_changePW_message').slideUp(500, function(){
                                        $(this).html('Error. Please contact Avi Kenny for support.').slideDown(500, closeAndResetModal);
                                    });
                                }

                            },
                            error: function(request, status, error) {
                                // Error handler
                                $('#modal_changePW_message').slideUp(500, function(){
                                    $(this).html('Error. Please contact Avi Kenny for support.').slideDown(500, closeAndResetModal);
                                });
                            }
                        });
                    },500);
                });
            });
        });

        // Focus on first element when a modal form loads
        $('.modal').on('shown.bs.modal', function() {
            document.activeElement.blur();
            $(this).find(".modal-body :input:visible").first().focus();
        });

    });
});



function closeAndResetModal() {
    
    // Clear variables
    pw_old = ""; pw_new_1 = ""; pw_new_2 = "";
    
    setTimeout( function() {
        
        // Close modal
        $('.modal').modal('hide');
        
        setTimeout( function() {
            // Reset modal DOM
            $('#modal_changePW_form').show();
            $('#modal_changePW_pw_old,#modal_changePW_pw_new_1,#modal_changePW_pw_new_2').val('');
            $('#modal_changePW_message').html("");
        }, 500 );
        
    }, 2000 );
    
}

var LMD_dataPortal = (function(){


    // PRIVATE VARS
    var indicatorData = {};
    var indicatorMetadata = {};


    // PUBLIC:  Stores indicator data (in "indicatorData" object)
    //          Keys are indicator IDs
    //          Values are objects containing four properties: Date (MySQL format), Month, Year, Value
    function addIndicatorData(indID, month, year, value) {
        var obj = {};
        obj.Date = year + "-" + twoDigits(month) + "-01";
        obj.Month = Number(month);
        obj.Year = Number(year);
        obj.Value = Number(value);
        indicatorData[indID] = indicatorData[indID] || [];
        indicatorData[indID].push(obj);
    }


    // PUBLIC:  Stores indicator metadata (in "indicatorMetadata" object)
    //          Keys are indicator IDs
    //          Values are objects containing various metadata fields as properties
    function addIndicatorMetadata(indID, metadata) {
        indicatorMetadata[indID] = metadata;
    }


    // PUBLIC:  Returns data array for a single indicator, based on indicator ID
    // Example: getIndicatorData(16) might return the following...
    //              [
    //                  { Date:"2014-12-01", Month:1, Year:2014, Value:33 },
    //                  { Date:"2015-01-01", Month:2, Year:2015, Value:44 },
    //                  { Date:"2015-02-01", Month:3, Year:2015, Value:55 }
    //              ]
    function getIndicatorData(indID) {
        return indicatorData[indID];
    }


    // PUBLIC:  Returns metadata object for a single indicator, based on indicator ID
    // Example: getIndicatorMetadata(16) might return the following...
    //                  { indName:"Number of CHWs", indDefinition:"A deployed CHW is...", ... },
    //
    function getIndicatorMetadata(indID) {
        return indicatorMetadata[indID];
    }


    // PUBLIC:  Sorts indicatorData by date
    function sortByDate() {
        for (var key in indicatorData) {
            indicatorData[key].sort(function(a,b){
                if ( (a.Year*12)+a.Month > (b.Year*12)+b.Month ) {
                    return -1;
                }
                if ( (a.Year*12)+a.Month < (b.Year*12)+b.Month ) {
                    return 1;
                } else {
                    return 0;
                }
            });
        }
    }


    // LMD_dataPortal API
    return {
        addIndicatorData: addIndicatorData,
        addIndicatorMetadata: addIndicatorMetadata,
        getIndicatorData: getIndicatorData,
        getIndicatorMetadata: getIndicatorMetadata,
        sortByDate: sortByDate
    };
    

})();
